Wanted to do something different so made a burn variation of my Salad Deck. The entire point of this deck is to be able to get salamangreat/cyberse monsters on the field to setup your combo's for your links/xyz/etc while at the same time being able to burn and recycle your monsters from the graveyard. Right now I am playing with different variations. Here's a video of the testing and on a side note I literally finished testing them then banlist came out, anyways enjoy.

&nbsp;

<a>https://www.youtube.com/watch?v=E_WHUQV64hs</a>

&nbsp;

UPDATE! good cards to add in this deck are 3 copies of demise of the land which activates mystic mine, and one copy of metaverse which does the same thing.

&nbsp;

This deck focuses on drawing all the five pieces of Exodia while holding back the opponent with the mystic mine.

Try to have 3 reckless greed seted because of that you draw 6 cards and you wait just 2 turns to draw again, not 6. A good way to add a piece or two or maybe if you are lucky all pieces.

To put it simply, this is only a Lost World Dinosaurs deck that techs Jewel Beast - Argosaurus to help further your plays. The deck uses 3 Babycerasaurus and 2 Petiteranodon so that you can pop them with Argosaurus and search more Dinosaurs from the deck--mostly your Souleating Oviraptor.

&nbsp;

Due to Argosaurus also being a Level 1 monster, you can summon it with Miscellaneousaurus, and if you sent Misc to the Graveyard with its effect first, your opponent will not be able to stop Argo's effect from going off. You still want to go second (obviously), since Argo's effect can make summoning Link Monsters easier, potentially allowing you summon your Link 3 and 4 monsters.

Ok Guys,

We want to draw or get access to Souleating Oviraptor, this is why we Main Extravaganz. With Lost World + Pankratops we can get access (Special Token, destroy Token, protect with Lost World, destroy Baby or Petiteranodon and summon Oviraptor) to our boi Oviraptor. We don’t play Pill, because it bricks hard.
Handtraps: Ash is one of the best in this format, Crow is for Orcust match up, Inpermanence for negating floodgates!!

&nbsp;

