This is my Yuri Anime Style Character Deck using cards he used throughout the Yugioh Arc V Series and the new support Yuri received for his deck , in the Yugioh Villain set Legendary Duelist Immortal Destiny and the Yugioh set Duel Power and Fusion Enforcers . I incorporated Yuri's new support into his deck since he didn't have a full 40 card deck in the Yugioh Arc V series. Yuri had two decks in the series an ancient gear one and a Predaplant one. I placed his ancient gear core into the side deck. This deck focuses on his Predaplant one. My Character decks are NOT meant for yugioh official tournaments. The link below will show you why the deck is built the way it is.

https://www.youtube.com/watch?v=eyBqAayh2WQ

